                this->pad(ping + 12 * 12 * d, pong + 14 * 14 * d, 12);

            memcpy(ping, pong, sizeof(float) * 14 * 14 * 24);
            

            // depthwise (6)
            for (int16_t d = 0; d < 24; d++)
                this->depthwise_conv(ping + 14 * 14 * d, pong + 6 * 6 * d, depthwise_6_weights[d], 14, 2);

            // pointwise (6)
            for (int16_t d = 0; d < 48; d++)
                this->pointwise_conv(pong, ping + 6 * 6 * d, pointwise_6_weights[d], 6, 24);
        
            
            // padding (7)
            for (int16_t d = 0; d < 48; d++)
                this->pad(ping + 6 * 6 * d, pong + 8 * 8 * d, 6);

            memcpy(ping, pong, sizeof(float) * 8 * 8 * 48);
            

            // depthwise (7)
            for (int16_t d = 0; d < 48; d++)
                this->depthwise_conv(ping + 8 * 8 * d, pong + 6 * 6 * d, depthwise_7_weights[d], 8, 1);

            // pointwise (7)
